features.script:
const cmsUrl =  "https://va-cms-api.voxelarchitects.com/projects/pixelchain-christmas-cabin";
const response = fetch(cmsUrl);
let cmsImages;

const features = parcel.getFeatures()
const cmsId = "cmsImage"
let images = [];

for (let i = 0; i < features.length; i++) {
  if (features[i]._content.id != undefined && features[i]._content.id.includes(cmsId)) {
      images.push(features[i])
  }
}

response.then((value) => {
  value.json().then((data) => {
    cmsImages = data  
    console.log(data.images)

    for (let i = 0; i < data.images.length && i < images.length; i++) {
      images[i].set({'url' : data.images[i].src})
      images[i].set({'link' : data.images[i].link})
      images[i].set({'blendMode': 'Combine'})    
    }    
  })
 });
